script: |
  super -f text -I q10489.spq | sort > q10489.out

inputs:
  - name: q10489.spq
    data: |
      SELECT + 23 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 * + col2 - + col2 >= ( 66 * + col1 );
  - name: tab2

outputs:
  - name: q10489.out
    data: |
      23
      23
      23
